import 'bootstrap/dist/css/bootstrap.min.css';
import './logo.svg';

function header() {
    return (
        <div>
            <header>
                <nav>
                    <img src={logo.svg} />
                    <a href="index.html" class="nav-links-first">
                        Home
                    </a>
                    <a class="nav-links" target="_blank">
                        Rating
                    </a>
                    <a class="nav-links" target="_blank">
                        Login
                    </a>
                </nav>
            </header>
        </div>
    );
}

export default header;
